import React, { Component } from 'react'

export class PostItem extends Component {
    render() {
        return (
            <div className="post">
                <div className="container">
                    <h2>{ this.props.post.title }</h2>
                    <pre>
                    {this.props.post.body}
                     </pre>
                    <button className="btn">Delete</button>
                </div>
            </div>
        )
    }
}

export default PostItem;
